import React from 'react';
import logo from './logo.svg';
import './App.css';
import './project_page.css';
import ProjectImg from "./ProjectImg"
import NavBar from "./NavBar"

function GooglePage() {
  return (
    <div className="app">
      <div className="main">
        <div className="app-header">
          <p className="nav-header">Go back</p>
            <div className="project-title">
              <h1 className="header1">Google Internship Summer 2018</h1>
            </div>
            <div className="project-description">
              <p className="header2">Prototyped solutions for discoverability in Google Sheets with an accessibility first lens.</p>
              <p className="header3">Role: UX Engineering Intern</p>
              <p className="header3">Team: Google Sheets</p>
            </div>
            <ProjectImg imgUrl={require("./assets/google/team.png")} height="35%" position="-50 -100px"/>
        </div>

      </div>


      <NavBar email="cathleenjia@berkeley.edu"/>


  </div>
  );
}

export default GooglePage;
